var title_f33_12_33985="RANK ligand and osteo form";
var content_f33_12_33985=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F66130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F66130&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 511px\">",
"   <div class=\"ttl\">",
"    RANKL and osteoclast formation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 491px; height: 468px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    RANKL (Receptor Activator of Nuclear Factor &kappa;B Ligand)&nbsp;is a potent inducer of osteoclast formation. Osteotropic factors, 1,25-(OH)2 vitamin D, parathyroid hormone (PTH), prostaglandin E-2 (PGE2) and interleukin-11 (IL-11), induce osteoclast formation by upregulating expression of RANKL on the surface of marrow stromal cells and immature osteoblasts. RANKL then binds its receptor RANK on the surface of osteoclast precursors and signals through the NF&kappa;B and JNK (Jun N-terminal kinase)&nbsp;pathways to induce osteoclastogenesis and promote osteoclast survival. In addition to RANK, a decoy receptor, osteoprotegerin (OPG/OCIF), inhibits RANKL binding to RANK. RANKL can also occur in a soluble form produced by T-cells in inflammatory states. The ratio of RANKL to OP cG determines the level of osteoclastogenesis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from&nbsp;Roodman GD. Mechanisms of bone metastases. N Engl J Med 2004; 350:1655.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
