var title_f33_12_33986="CHD mortality related to BP and age";
var content_f33_12_33986=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F75106%7ENEPH%2F66793&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F75106%7ENEPH%2F66793&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 564px\">",
"   <div class=\"ttl\">",
"    CHD mortality related to blood pressure and age",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 544px; height: 398px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Coronary heart disease (CHD) mortality rate, pictured on a log scale with 95 percent confidence intervals, in each decade of age in relation to the estimated usual systolic and diastolic blood pressure at the start of that decade. CHD mortality increases with both higher pressures and older ages. For diastolic pressure, each age-specific regression line ignores the left-hand point (ie, at slightly less than 75 mmHg) for which the risk lies significantly above the fitted regression line (as indicated by the broken line below 75 mmHg).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Prospective Studies Collaboration, Lancet 2002; 360:1903.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 550px\">",
"   <div class=\"ttl\">",
"    Stroke mortality related to blood pressure and age",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 530px; height: 390px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Stroke mortality rate, pictured on a log scale with 95 percent confidence intervals, in each decade of age in relation to the estimated usual systolic and diastolic blood pressure at the start of that decade. Stroke mortality increases with both higher pressures and older ages. For diastolic pressure, each age-specific regression line ignores the left-hand point (ie, at slightly less than 75 mmHg), for which the risk lies significantly above the fitted regression line (as indicated by the broken line below 75 mmHg).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Prospective Studies Collaboration, Lancet 2002; 360:1903.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
