"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_general\" href=\"mobipreview.htm?19/28/19910?source=see_link\">",
"    see \"Vitamin E: Drug information\"",
"   </a>",
"   and",
