"     </li>",
"     <li>",
"      Aqua Gem-E&trade; [OTC];",
"     </li>",
"     <li>",
"      Aquasol E&reg; [OTC];",
"     </li>",
"     <li>",
"      d-Alpha Gems&trade; [OTC];",
"     </li>",
"     <li>",
"      E-Gems&reg; Elite [OTC];",
"     </li>",
"     <li>",
