" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Diagnosis of suspected deep vein thrombosis of the lower extremity",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?33/12/33994/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?33/12/33994/contributors\">",
"     Brydon JB Grant, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?33/12/33994/contributors\">",
"     Section Editors",
"    </a>",
