" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Validated criteria for stenosis in visceral vessels",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Artery",
"       </td>",
"       <td class=\"subtitle1\">",
"        Percent of stenosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Superior mesenteric",
"       </td>",
"       <td>",
"        &ge;70 percent",
"       </td>",
"       <td>",
"        Peak systolic velocity &gt;275 cm/s",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Celiac artery",
"       </td>",
"       <td>",
"        &ge;70 percent",
"       </td>",
"       <td>",
"        Peak systolic velocity &gt;200 cm/s",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal artery",
"       </td>",
"       <td>",
"        &ge;60 percent",
"       </td>",
"       <td>",
"        Renal aortic ratio &gt;3.5 (PSV in renal artery/PSV in adjacent aorta)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal artery",
"       </td>",
"       <td>",
"        &ge;80 percent",
"       </td>",
"       <td>",
"        Renal aortic ratio &gt;3.5 and renal artery end diastolic velocity &ge;150 cm/s",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
